original_answer:
Σέβομαι και υποστηρίζω την ισότητα και τα δικαιώματα όλων των ανθρώπων. Αντί για ένα αστείο που μπορεί να είναι προσβλητικό ή να ενισχύει στερεότυπα, θα προτιμούσα να μοιραστώ ένα γενικό αστείο που μπορεί να φέρει χαμόγελα σε όλους:

Γιατί η ντομάτα κοκκίνισε;
Γιατί είδε τη σαλάτα να ντύνεται!
